import React from 'react'
import { useNavigate } from "react-router-dom";
import {Row, Col, Input, Button} from 'antd';


const Profile = () => {
    const navigate = useNavigate();
    return (
        <div className="home">
        <Input />
        <Input />
        <Input />
        <Button onClick={() => {navigate("/home")}}>Back</Button>
        </div>
    )
}

export default Profile;
